import React from "react"

function Card ({ cardObj, handleDecklist }) {

    return (
    <li>
        <img id={cardObj.id} onClick={handleDecklist} alt={cardObj.cardName} src={`${cardObj.imageUrl}`} />
        <p>Set: {cardObj.setName}</p>
    </li>
    )
}

export default Card
